class Solution(object):
    def createGraph(self, A):
        cols = len(A)
        rows = len(A[0])
        nodes = set()
        edges = {}
        for r in xrange(rows):
            for c in xrange(cols):
                nodes.add((r, c))
                edges[(r, c)] = set()
                if r > 0:
                    edges[(r, c)].add((r - 1, c))
                if r < rows - 1:
                    edges[(r, c)].add((r + 1, c))
                if c > 0:
                    edges[(r, c)].add((r, c - 1))
                if c < cols - 1:
                    edges[(r, c)].add((r, c + 1))
        return nodes, edges, rows, cols

    def addEdgesOfNode(self, node, edges, cluster_nodes, reachable_nodes, A):
        for e in edges[node]:
            if e in cluster_nodes:
                continue
            score_from_node = min(cluster_nodes[node], A[e[1]][e[0]])
            if not e in reachable_nodes:
                reachable_nodes[e] = score_from_node
            else:
                reachable_nodes[e] = max(score_from_node, reachable_nodes[e])

    def getMaxScore(self, reachable_nodes):
        maximum = None
        max_node = None
        for node in reachable_nodes:
            if maximum == None or maximum < reachable_nodes[node]:
                maximum = reachable_nodes[node]
                max_node = node
        return max_node, maximum

    def maximumMinimumPath(self, A):
        """
        :type A: List[List[int]]
        :rtype: int
        """
        nodes, edges, rows, cols = self.createGraph(A)
        cluster_nodes = {}
        reachable_nodes = {}
        cluster_nodes[(0, 0)] = A[0][0]
        self.addEdgesOfNode((0, 0), edges, cluster_nodes, reachable_nodes, A)

       	while True:
            node, score = self.getMaxScore(reachable_nodes)
            if node == None:
                break
            if node == (rows - 1, cols - 1):
                return score
            del reachable_nodes[node]
            cluster_nodes[node] = score
            self.addEdgesOfNode(node, edges, cluster_nodes, reachable_nodes, A)

